  `burn_result_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '烧录结果返回时间',
  `burn_bath_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '烧录批次id，每次请求烧录后台生成',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 882 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '软件烧录结果表' ROW_FORMAT = COMPACT;

